import datetime
import heapq

def cookies4(k, A):
    # Write your code here
    A.sort()
    iterations = 0
    while len(list(filter(lambda x: x < k, A))) > 0 and len(A) >= 2:
        least = min(A)
        A.remove(least)
        second_least = min(A)
        A.remove(second_least)
        A.append(least + 2*second_least)
        iterations += 1
    #     print(least, second_least)
    # print(A, iterations)
    
    return -1 if len(A) == 1 and A[0] < k else iterations

def cookies3(k, A):
    # Write your code here
    iterations = 0
    while len(list(filter(lambda x: x < k, A))) > 0 and len(A) >= 2:
        A.sort()
        least = A[0]
        second_least = A[1]
        A.remove(least)
        A.remove(second_least)
        A.append(least + 2*second_least)
        iterations += 1
    #     print(least, second_least)
    # print(A, iterations)
    
    return -1 if len(A) == 1 and A[0] < k else iterations

def cookies(k, A:list):
    # Write your code here
    A.sort()
    sub = [x for x in A if x < k]
       
    sub2 = A[len(sub):]
    iterations = 0
        
    while len(sub) >= 2:
        sub.sort()
        least = sub[0]
        second_least = sub[1]
        sub.remove(least)
        sub.remove(second_least)
        result = least + 2*second_least
        if result < k:
            sub.append(result)
        else:
            if result == k:
                sub2.insert(0, result)
            else:
                sub2.append(result)
        iterations += 1

    if len(sub) == 0:
        return iterations
    
    elif sub[0] >= k and len(sub) == 0:
        return iterations + 1
    
    elif sub[0] < k and len(sub2) > 0:
        return iterations + 1
    
    return - 1

def cookies_with_heap(k, A:list): # only way i could pass exceution time probles in HR
    heapq.heapify(A)

    iterations = 0
    while len(A) >= 2:
        least = heapq.heappop(A)
        if least >= k:
            return -1 if iterations == 0 else iterations
        second_least = heapq.heappop(A)
        heapq.heappush(A, least + 2*second_least)
        iterations += 1

    return -1 if A[0] < k and len(A) == 1 else iterations


